import React, { useEffect, useState, useRef } from "react";
import { useSelector,useDispatch } from "react-redux";
import {listCatByProduct} from "../actions/products";
const ProductByCategory = (props) => {
  const dispatch = useDispatch();
  const pData = useSelector(state => state.productsApi);
  useEffect(()=>{
    const fData = {
      'id':atob(props?.match?.params?.id)
    }
    dispatch(listCatByProduct(fData));
  },[]);
  return (
    <div className="space-y-8">
      <div className="grid grid-cols-4 gap-4">
        <div className="max-w-sm rounded overflow-hidden shadow-lg">
          <img className="w-full" src="https://www.eatthis.com/wp-content/uploads/sites/4/2020/10/fast-food.jpg?quality=82&strip=all" alt="Mountain" />
          <div className="px-6 py-4">
            <div className="font-bold text-xl mb-2">Mountain</div>
            <p className="text-gray-700 text-base">
              Lorem ipsum dolor sit amet, consectetur adipisicing elit. Voluptatibus quia, Nonea! Maiores et perferendis eaque, exercitationem praesentium nihil.
            </p>
          </div>
          <div className="px-6 pt-4 pb-2">
          <span className="inline-block bg-gray-200 rounded-full px-3 py-1 text-sm font-semibold text-gray-700 mr-2 mb-2">#photography</span>
          <span className="inline-block bg-gray-200 rounded-full px-3 py-1 text-sm font-semibold text-gray-700 mr-2 mb-2">#travel</span>
          <span className="inline-block bg-gray-200 rounded-full px-3 py-1 text-sm font-semibold text-gray-700 mr-2 mb-2">#winter</span>
          </div>
        </div>

        <div className="max-w-sm rounded overflow-hidden shadow-lg">
          <img className="w-full" src="https://www.eatthis.com/wp-content/uploads/sites/4/2020/10/fast-food.jpg?quality=82&strip=all" alt="Mountain" />
